import React, { Component } from 'react';

// Data
import learnCards from '../data/learn';

class LearningCards extends Component {
    render() {
        let data = learnCards;
        console.log("Data: ", data);
        return(
            <div>Learning Card</div>
        );
    }
}

export default LearningCards;
